// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract cropregistration {
    struct Crop {
        string name;
        uint area;
        string district;
    }

    mapping(address => Crop) public fasal;
    Crop[] public upaj;

    mapping(string => mapping(string => uint)) public totalAreaByDistrict;

    string[] public haryanaDistricts = ["Ambala", "Bhiwani", "Charkhi Dadri", "Faridabad", "Fatehabad", "Gurugram", "Hisar", "Jhajjar", "Jind", "Kaithal", "Karnal", "Kurukshetra", "Mahendragarh", "Nuh", "Palwal", "Panchkula", "Panipat", "Rewari", "Rohtak", "Sirsa", "Sonipat", "Yamunanagar"];

    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function registerCrop(string memory _name, uint _area, string memory _district) public {
        require(keccak256(abi.encodePacked(_name)) == keccak256(abi.encodePacked("wheat")), "Only wheat crops can be registered");

        bool isValidDistrict = false;
        for(uint256 i = 0; i < haryanaDistricts.length; i++) {
            if(keccak256(bytes(haryanaDistricts[i])) == keccak256(bytes(_district))) {
                isValidDistrict = true;
                break;
            }
        }
        require(isValidDistrict == true, "Invalid district. Please provide a valid district from Haryana");

        Crop memory newCrop = Crop(_name, _area, _district);
        fasal[msg.sender] = newCrop;
        upaj.push(newCrop);
        totalAreaByDistrict[_district][_name] += _area;
    }

    function getTotalAreaByDistrict(string memory _district, string memory _name) public view returns (uint) {
        return totalAreaByDistrict[_district][_name];
    }

    function estimateTotalProduce(string memory _name) public view returns (uint) {
        uint totalArea = 0;
        for (uint i = 0; i < upaj.length; i++) {
            if (keccak256(bytes(upaj[i].name)) == keccak256(bytes(_name))) {
                totalArea += upaj[i].area;
            }
        }
        return totalArea * 24;
    }

}
